#include <stdio.h>
#include <stdlib.h>
#include <stdbool.h>

typedef struct Stack {
    char *palavra;
    char topo;
    int limite;
} Stack;

bool Push(Stack *pilha,char letra);
void Pop(Stack *pilha);

int maximumGain(char* s, int x, int y) {
    int i = 0;
    Stack *pilha = NULL;
    Stack *outraPilha = NULL;
    int soma =0;

    if( ( pilha = (Stack *)calloc(1,sizeof(Stack))) == NULL){
        exit(EXIT_FAILURE);
    }

    if( ( outraPilha = (Stack *)calloc(1,sizeof(Stack))) == NULL){
        exit(EXIT_FAILURE);
    }

    pilha->limite = 0;
    pilha->palavra = NULL;
    pilha->topo = '\0';

    outraPilha->limite = 0;
    outraPilha->palavra = NULL;
    outraPilha->topo = '\0';

    if(y > x){
        while(s[i] != '\0')
        {
            if(pilha->limite > 0)
            {
                if(pilha->topo == 'b' && s[i] == 'a') {
                    Pop(pilha);
                    soma += y;
                    i++;
                    continue;
                }
            }
            Push(pilha,s[i]);
            i++;
        }

        Push(pilha,s[i]);
        i = 0;
        

        while(pilha->palavra[i] != '\0')
            {
                if (outraPilha->topo == 'a' && pilha->palavra[i] == 'b') {
                    Pop(outraPilha);
                    soma += x;
                    i++;
                    continue;
            }
            Push(outraPilha,pilha->palavra[i]);
            i++;
        }
    } else {
        while(s[i] != '\0')
            {
            if (pilha->topo == 'a' && s[i] == 'b') {
                Pop(pilha);
                soma += x;
                i++;
                continue;
            }
            Push(pilha,s[i]);
            i++;
        }

        Push(pilha,s[i]);
        i = 0;

        while(pilha->palavra[i] != '\0')
        {
            if(outraPilha->topo == 'b' && pilha->palavra[i] == 'a') {
                Pop(outraPilha);
                soma += y;
                i++;
                continue;
            }
            Push(outraPilha,pilha->palavra[i]);
            i++;
        }
    }

    free(pilha->palavra);
    free(pilha);

    free(outraPilha->palavra);
    free(outraPilha);

    return soma;
}

bool Push(Stack *pilha,char letra){
    char *nova_palavra = realloc(pilha->palavra, sizeof(char) * (pilha->limite + 1));

    if (nova_palavra == NULL) {
        return false; 
    }

    pilha->palavra = nova_palavra;
    pilha->palavra[pilha->limite] = letra; 
    pilha->limite++;
    pilha->topo = letra;

    return true;
}

void Pop(Stack *pilha){
    if (pilha->limite == 0) {
        pilha->topo = '\0'; 
        return;
    }

    pilha->limite--; 

    if (pilha->limite > 0) {
        pilha->topo = pilha->palavra[pilha->limite - 1]; 
    } 
    else 
    {
        pilha->topo = '\0'; 
    }

    char *nova_palavra = realloc(pilha->palavra, sizeof(char) * pilha->limite);
    if (nova_palavra != NULL || pilha->limite == 0) {
        pilha->palavra = nova_palavra;
    }
}



int main() {
    char s[] = "";
    int x = 4;
    int y = 5;

    int result = maximumGain(s, x, y);

    printf("%d\n", result);

    return 0;
}
